    useEffect(()=>{


        async function getSearchList(){
            try{
                const res = await getSearch({city:props.city,})
            } catch(error) {
                console.log(error)
            }

        }
    },[])



  return (
    <div>
        {/* 公共头部 */}
        <CommonHeader>
            <MyInput/>
        </CommonHeader>
        {/* 搜索列表 */}
        <SearchList/>
    </div>
  )
}

